import classes from "./MealsSummary.module.scss";

const MealsSummary = () => {
  return (
    <section className={classes.summary}>
      <h2>Vị ngon trên từng ngón chân</h2>
      <p>
      Như chúng ta đã biết, Việt Nam nằm trong top những đất nước có nền ẩm thực phong phú, đa dạng và ngon nhất thế giới. Mỗi món ăn Việt đều để lại những ấn tượng sâu sắc trong lòng các thực khách nước ngoài khi đến Việt Nam. Dù dân dã, giản dị nhưng mang đậm hương hồn Việt.
      </p>
      <p>
      Chỉ tay lên trời hận đời bỏ đói - Úp mặt xuống gối bỏ đói thật sao.

      </p>
    </section>
  );
};

export default MealsSummary;
